import axios from "axios";
import dotenv from "dotenv";

dotenv.config();

const KEY = process.env.YOUTUBE_API_KEY;

console.log(KEY);

export default axios.create({
  baseURL: "https://www.googleapis.com/youtube/v3/",
  params: {
    part: "snippet",
    maxResults: 20,
    key: KEY,
  },
});
